import React from 'react';
import styles from "./Note.module.css"
import {Link} from "react-router-dom";

const Note = ({note, counter}) => {
    const isPrivate = ()=>{
        if(note.prv){return "private"}
        else return "public"
    }
    console.log(note)
    return (
        <Link className={styles.wrapper}>
            <div className={styles.name_counter}>
                <div>{counter}</div>
                <div>{note.name}</div>
                <div>{isPrivate()}</div>
                <div>Words: 1000</div>
            </div>

            <button className={styles.delete_btn}>Remove</button>
        </Link>
    );
};

export default Note;
